from stw_py_api_runtime.gen_classes.types.enum_type import EnumType
from stw_gen_sample3_api.basic_types import *


class VoltageEvents(EnumType):
    """События преодоления порогов напряжения"""

    @classmethod
    def _base_type(cls):
        return uint8_t

    # Нормальный уровень напряжения
    Normal = 0
    # Превышение верхнего порога напряжения
    Over = 1
    # Превышение нижнего порога напряжения
    Under = 2
